import React from "react";
import Head from "next/head";

import AppLayout from "../components/AppLayout";

const Profile = () => (
  <AppLayout>
    <Head>
      <title>프로필 | NodeBird</title>
    </Head>
    <div>내 프로필</div>
  </AppLayout>
);

export default Profile;
